import React from 'react';
import { useNavigate } from 'react-router-dom';

const Contact = () => {
	let navigate = useNavigate();
	return (
		<div>
			<h1>Contact</h1>
		     <h2>Please reach us @www.burgernbite.com</h2>
<h3>Contact us in: 000123456</h3>
			<button
				type="button"
				className="btn btn-primary"
				onclick={() => {
					navigate("/about")
				}}
			>
				Back to Homepage
			</button>
		</div>
	);
};

export default Contact;
